import React, { Fragment } from 'react';

const Item = ({itemValue}) => {
    return (
        <Fragment>
        <ol className='output-list-item'>
            <li className='li-item'>{itemValue}</li>
            <button className='delete-item-button'>Delete</button>
        </ol>
        </Fragment>
    )
}

export default Item;
